import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

const HomeContainer = styled.div`
  background-color: #f8f9fa;
  min-height: 100vh;
  padding: 1.5rem;
`;

const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
  gap: 2rem;
`;

const RouteGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const RouteCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
  cursor: pointer;
  transition: transform 0.2s ease, box-shadow 0.2s ease;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 6px 12px rgba(0, 0, 0, 0.1);
  }
`;

const RouteHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 1rem;
`;

const RouteName = styled.h3`
  color: #002B5C;
  font-size: 1.2rem;
  margin: 0;
  font-weight: 600;
`;

const StatusIcon = styled.div`
  width: 24px;
  height: 24px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: ${props => 
    props.status === 'on-time' ? '#d4edda' : 
    props.status === 'delayed' ? '#f8d7da' : 
    props.status === 'approaching' ? '#fff3cd' : '#e2e3e5'
  };
  color: ${props => 
    props.status === 'on-time' ? '#155724' : 
    props.status === 'delayed' ? '#721c24' : 
    props.status === 'approaching' ? '#856404' : '#383d41'
  };
  font-size: 0.8rem;
`;

const NextArrival = styled.div`
  color: #666;
  font-size: 1rem;
`;

const WeatherWidget = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
  display: flex;
  align-items: center;
  gap: 1.5rem;
`;

const WeatherIcon = styled.div`
  font-size: 2.5rem;
`;

const WeatherInfo = styled.div`
  flex: 1;
`;

const WeatherTemp = styled.div`
  color: #002B5C;
  font-size: 1.8rem;
  font-weight: 600;
  margin-bottom: 0.25rem;
`;

const WeatherDesc = styled.div`
  color: #666;
  font-size: 1rem;
`;

const WeatherLocation = styled.div`
  color: #999;
  font-size: 0.9rem;
`;

const Home = () => {
  const navigate = useNavigate();
  const [weatherData, setWeatherData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Sample route data - in a real app, this would come from an API
  const routes = [
    { id: 'OSW10', name: 'OSW10 Blue Route', status: 'on-time', nextArrival: '5 min' },
    { id: 'OSW20', name: 'OSW20 Red Route', status: 'delayed', nextArrival: '12 min' },
    { id: 'OSW30', name: 'OSW30 Green Route', status: 'approaching', nextArrival: '2 min' },
    { id: 'OSW40', name: 'OSW40 Yellow Route', status: 'on-time', nextArrival: '8 min' },
    { id: 'OSW50', name: 'OSW50 Purple Route', status: 'on-time', nextArrival: '15 min' },
    { id: 'OSW60', name: 'OSW60 Orange Route', status: 'delayed', nextArrival: '20 min' },
  ];

  useEffect(() => {
    const fetchWeather = async () => {
      try {
        const API_KEY = 'ab385b44b9b33d12cf4397188ca4381b';
        const city = 'Oswego,NY,US';
        const units = 'imperial';

        console.log('Fetching weather data...');
        const response = await fetch(
          `https://api.openweathermap.org/data/2.5/weather?q=${city}&units=${units}&appid=${API_KEY}`
        );

        console.log('Weather API response status:', response.status);

        if (!response.ok) {
          throw new Error(`Weather API error: ${response.status}`);
        }

        const data = await response.json();
        console.log('Weather data received:', data);

        if (!data || !data.main || !data.weather || !data.weather[0]) {
          throw new Error('Invalid weather data format');
        }

        setWeatherData(data);
        setError(null);
      } catch (err) {
        console.error('Error fetching weather:', err);
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchWeather();
  }, []);

  const getStatusIcon = (status) => {
    switch (status) {
      case 'on-time':
        return '✓';
      case 'delayed':
        return '⚠';
      case 'approaching':
        return '→';
      default:
        return '?';
    }
  };

  const getWeatherIcon = (condition) => {
    switch (condition) {
      case 'Clear':
        return '☀️';
      case 'Clouds':
        return '☁️';
      case 'Rain':
        return '🌧️';
      case 'Snow':
        return '🌨️';
      case 'Thunderstorm':
        return '⛈️';
      case 'Drizzle':
        return '🌦️';
      case 'Mist':
      case 'Fog':
        return '🌫️';
      default:
        return '🌤️';
    }
  };

  return (
    <HomeContainer>
      <Navbar />
      <ContentWrapper>
        <RouteGrid>
          {routes.map(route => (
            <RouteCard key={route.id} onClick={() => navigate(`/route/${route.id}`)}>
              <RouteHeader>
                <RouteName>{route.name}</RouteName>
                <StatusIcon status={route.status}>
                  {getStatusIcon(route.status)}
                </StatusIcon>
              </RouteHeader>
              <NextArrival>Next arrival: {route.nextArrival}</NextArrival>
            </RouteCard>
          ))}
        </RouteGrid>

        <WeatherWidget>
          {loading ? (
            <div>Loading weather data...</div>
          ) : error ? (
            <div>Error loading weather: {error}</div>
          ) : weatherData ? (
            <>
              <WeatherIcon>
                {getWeatherIcon(weatherData.weather[0].main)}
              </WeatherIcon>
              <WeatherInfo>
                <WeatherTemp>{Math.round(weatherData.main.temp)}°F</WeatherTemp>
                <WeatherDesc>{weatherData.weather[0].description}</WeatherDesc>
                <WeatherLocation>Oswego, NY</WeatherLocation>
              </WeatherInfo>
            </>
          ) : null}
        </WeatherWidget>
      </ContentWrapper>
    </HomeContainer>
  );
};

export default Home;
